import React, { useState } from "react";
import GreenRow from '../GreenRow/GreenRow';
import YellowRow from '../YellowRow/YellowRow';
import "./RowList.css";

// create 5 rows in a vertical fashion
const RowList = () => {
    const [rows, setRows] = useState([<GreenRow />, <YellowRow />]);
    const [results, setResults] = useState(['shit', 'ass']);

    const createYellow = () => {
        if (rows.length >= 5) return;
        setRows([...rows, <YellowRow />]);
    };

    const deleteYellow = () => {
        if (rows.length <= 2) return;
        setRows(rows.slice(0, -1));
    };

    return(
        <div>
            <div className="buttons">
                <button onClick={createYellow}>Add Row</button>
                <button onClick={deleteYellow}>Delete Row</button>
            </div>

            {/* create elements in rows state */}
            {rows.map((row) => (
                <div>
                    {row}
                </div>
            ))}
            <div className="results">
                {results ? results.map((result) => (
                    <text style={{color: "black"}}>{result}, </text>
                ))
                :''}
            </div>
        </div>
    );
}

export default RowList;
